import {  StyleSheet, Text, View } from 'react-native';
import { styles } from '../../style';

function Footer() {

    return (
      <View>
        <View style={styles.footer}>
          <Text style={styles.footer-text}>Footerrrr</Text>
        </View>
      </View>
    )
  }
  
  export default Footer
